import React from 'react'
import './DetailsCard.css'

const DetailsCard = (props) => {
    return (
        <div>
            <p>{props.marketName}</p>
            <p>{props.cmdtyName}</p>
            <p>{props.minPrice}-{props.minPrice}/{props.priceUnit}</p>
            {/* <p></p> */}
        </div>
    )
}

export default DetailsCard
